import React from "react";

const todos = [
  {
    title: "finish yor homework",
    isCompleted: false,
  },
  {
    title: "wash dishes",
    isCompleted: false,
  },
  {
    title: "watch TV",
    isCompleted: false,
  },
];
const Home = () => {
  return <div className="bg-gray-900 h-screen">Home</div>;
  {
    todos.map((todo) => <div>{todo.title}</div>);
  }
};
export default Home;
